String _clubKey(String club) {
  // Normalize club names so small formatting differences (spaces, NBSP, dots)
  // don't break matching between UI strings and doc strings.
  final kept = club.replaceAll(RegExp(r"[^0-9A-Za-z\uAC00-\uD7A3]+"), "");
  return kept.toLowerCase();
}

List<_DocRosterEntry> _docRosterForClub(String club) {
  final key = _clubKey(club);
  return _docRosterEntries.where((e) => _clubKey(e.meta.club) == key).toList();
}

// Fallback (for names missing from the doc mapping).
String _fallbackKLeagueClubForName(String name) {
  final teams = _kLeagueTeams;
  if (teams.isEmpty) return 'K League';
  final seed = _stableSeedFromKey('club|$name');
  return teams[seed % teams.length];
}

int _fallbackJerseyNumberForName(String name) {
  final seed = _stableSeedFromKey('no|$name');
  return (seed % 99) + 1;
}

String _fallbackPositionForName(String name) {
  // Uses the current (cached) player pool so it matches what the app shows.
  final pool =
      _MatchDetailPageState._cachedSoccerPlayers ?? _buildPlayerPool(Random(0));
  final hit = pool.where((p) => p.name == name).toList();
  if (hit.isNotEmpty) return hit.first.position;
  return '—';
}

// Unified accessor used across the app.
({String position, String club, int number}) _resolvePlayerMeta(String name) {
  final doc = _docMetaByName[name];
  final position = doc?.position ?? _fallbackPositionForName(name);
  final club = doc?.club ?? _fallbackKLeagueClubForName(name);
  final number = doc?.number ?? _fallbackJerseyNumberForName(name);
  return (position: position, club: club, number: number);
}
